/*
 * Input string or char-array with start x and y values (top left corner)
 */
void drawString(unsigned char inputString[],unsigned int startX, unsigned int startY){
	for(int charIndex = 0; charIndex < strlen(inputString); charIndex++){
		drawChar(startX+8*charIndex, startY, inputString[charIndex], charMap);

	}
}

/*
 * Draw a single char from a charMap
 */
void drawChar(unsigned int startX, unsigned int startY, unsigned char charCode, unsigned char charMap[256][64]){
	unsigned char index = 0;

	for (int i = startY; i <= startY+7; i++) {
		for (int j = startX; j <= startX+7; j++) {
			//If color of pixel is 199 then ignore it (invisible/transparent)
			if(charMap[charCode][index] != 199){
				drawPixel(j, i, 255);
			}
			index++;
		}
	}


}
